/*---------------------------------------------------------------------------------**//**
* Basic WKT parse test for WKT with a 7 param specification
* @bsimethod
+---------------+---------------+---------------+---------------+---------------+------*/
TEST_F (SpecificWKTTests, ParseWKTTest)
    {
    GeoCoordinates::BaseGCSPtr currentGCS;

    currentGCS = GeoCoordinates::BaseGCS::CreateGCS();
    size_t number = s_ListOfDatumWKTs.size();
    size_t index = 0;
    for (auto theStruct : s_ListOfDatumWKTs)
        {
        index++;
        Utf8String wellKnownText = theStruct.m_WKT;
        std::cerr << "Testing " << index << " of " << number << std::endl;  
        EXPECT_TRUE(GeoCoordinates::GeoCoordParse_Success == currentGCS->InitFromWellKnownText(NULL, NULL, wellKnownText.c_str()));

        EXPECT_TRUE(currentGCS->IsValid());
        EXPECT_TRUE(currentGCS->GetDatumName() == theStruct.m_datumKeyName);
        }
    }
  
