/*---------------------------------------------------------------------------------**//**
* Basic WKT parse test make sure we got the good one
* @bsimethod
+---------------+---------------+---------------+---------------+---------------+------*/
TEST_F (SpecificWKTTests, ParseWKTTest2)
    {
    GeoCoordinates::BaseGCSPtr currentGCS;

    currentGCS = GeoCoordinates::BaseGCS::CreateGCS();
    size_t number = s_ListOfOtherWKTs.size();
    size_t index = 0;
    for (auto theStruct : s_ListOfOtherWKTs)
        {
        index++;
        Utf8String wellKnownText = theStruct.m_WKT;
        std::cerr << "Testing " << index << " of " << number << std::endl;  
        EXPECT_TRUE(GeoCoordinates::GeoCoordParse_Success == currentGCS->InitFromWellKnownText(NULL, NULL, wellKnownText.c_str()));

        EXPECT_TRUE(currentGCS->IsValid());
        GeoCoordinates::BaseGCSPtr compareGCS = GeoCoordinates::BaseGCS::CreateGCS(theStruct.m_keyName.c_str());
        EXPECT_TRUE(compareGCS.IsValid() && compareGCS->IsValid());
        compareGCS->SetVerticalDatumByKey(theStruct.m_vDatum.c_str());

        EXPECT_TRUE(currentGCS->IsEquivalent(*compareGCS));
        }
    }

