/*---------------------------------------------------------------------------------**//**
* Basic WKT parse of invalid WKTs
* @bsimethod                                                    Alain.Robert  11/2021
+---------------+---------------+---------------+---------------+---------------+------*/
TEST_F (SpecificWKTTests, ParseWKTValidTest)
    {
    GeoCoordinates::BaseGCSPtr currentGCS;

    currentGCS = GeoCoordinates::BaseGCS::CreateGCS();
    size_t number = s_ListOfValidWKTs.size();
    size_t index = 0;
    for (auto wellKnownText : s_ListOfValidWKTs)
        {
        index++;
        std::cerr << "Testing valid WKT " << index << " of " << number << std::endl;  
        EXPECT_TRUE(GeoCoordinates::GeoCoordParse_Success == currentGCS->InitFromWellKnownText(NULL, NULL, wellKnownText.c_str()));
        }
    }